import React,{useContext} from "react";
import ComC from "./ComC";
import { FirstName, LastName } from "./App1";



// This method is useContext much better to previous  method which used in ComC

const ComB = () => {
    const fname = useContext(FirstName);
    const lname = useContext(LastName);
    return (
        <>
            <h1>
                IN Component B My name is {fname} {lname}
            </h1>
            <ComC />

        </>
    );
};
export default ComB;
